texas_migrate_programs.settings:
  path: 'admin/config/services/texas-program-settings'
  defaults:
   _form: '\Drupal\texas_migrate_programs\Form\QualtricsSettingsForm'
  requirements:
    _permission: 'administer site configuration'

texas_migrate_programs.texas_migrate_programs_controller_content:
  path: 'texas_migrate_programs'
  defaults:
    _controller: '\Drupal\texas_migrate_programs\Controller\Migrate_TexasController::content'
    _title: 'Import Qualtrics survey results'
  requirements:
    _permission: 'administer site configuration'
